import{_ as e,c as i,o,ah as n,aA as r,aB as t,aC as s}from"./chunks/framework.Q_8nPqYE.js";const h=JSON.parse('{"title":"Moja Kancelarija","description":"","frontmatter":{"title":"Moja Kancelarija"},"headers":[],"relativePath":"my-office.md","filePath":"my-office.md"}'),l={name:"my-office.md"};function p(d,a,m,u,c,j){return o(),i("div",null,[...a[0]||(a[0]=[n('<figure style="text-align:center;margin:2rem auto;max-width:680px;width:100%;"><img src="'+r+'" alt="Moja kancelarija" style="display:block;margin:0 auto;max-width:680px;width:100%;"></figure><h1 id="moja-kancelarija" tabindex="-1">Moja Kancelarija <a class="header-anchor" href="#moja-kancelarija" aria-label="Permalink to “Moja Kancelarija”">​</a></h1><h2 id="sta-je-„moja-kancelarija" tabindex="-1">Šta je „Moja Kancelarija“ <a class="header-anchor" href="#sta-je-„moja-kancelarija" aria-label="Permalink to “Šta je „Moja Kancelarija“”">​</a></h2><p>Moja Kancelarija predstavlja katalog obrazaca namenjenih za plaćanje taksi Privrednoj komori Srbije u vezi sa uslugama iz oblasti upravljanja stambenom zajednicom. Svaki obrazac sadrži jasno definisana polja koja je potrebno popuniti prilikom podnošenja konkretnog zahteva.</p><h2 id="kako-funkcionise-proces" tabindex="-1">Kako funkcioniše proces <a class="header-anchor" href="#kako-funkcionise-proces" aria-label="Permalink to “Kako funkcioniše proces”">​</a></h2><p>Pre svega je potrebno odabrati šablon zahteva za koji želite da platite taksu. Večina šablona sadrže mandatorna polja koja je potrebno popuniti. Nakon unosa svih neophodnih podataka, aplikacija vas automatski vodi na deo za elektronsko plaćanje takse za izabrani zahtev, čime se postupak plaćanja završava.</p><h2 id="primeri-izgleda-sablona" tabindex="-1">Primeri izgleda šablona <a class="header-anchor" href="#primeri-izgleda-sablona" aria-label="Permalink to “Primeri izgleda šablona”">​</a></h2><p>Svaki šablon ima istaknutu cenu za svaku uslugu kao i ime zahteva na koji se odnosi. Takođe pregled istorije podnetih zahteva je dostupan u sličnom pregledu zajedno sa statusima svakog pojedinačnog zahteva.</p><h3 id="izgled-spiska-sablona-i-cene" tabindex="-1">Izgled spiska šablona i cene <a class="header-anchor" href="#izgled-spiska-sablona-i-cene" aria-label="Permalink to “Izgled spiska šablona i cene”">​</a></h3><figure style="text-align:center;margin:1.5rem auto;max-width:900px;width:100%;"><img src="'+t+'" alt="Spisak šablona (template-a) sa pripadajućim cenama za svaku uslugu" style="display:block;margin:0 auto;max-width:900px;width:100%;border:1px solid #e5e7eb;border-radius:8px;"><figcaption style="margin-top:.5rem;color:#666;">Spisak šablona (template-a) sa pripadajućim cenama za svaku uslugu</figcaption></figure><h3 id="izgled-istorije-placanja-i-statusi" tabindex="-1">Izgled istorije plaćanja i statusi <a class="header-anchor" href="#izgled-istorije-placanja-i-statusi" aria-label="Permalink to “Izgled istorije plaćanja i statusi”">​</a></h3><figure style="text-align:center;margin:1.5rem auto;max-width:900px;width:100%;"><img src="'+s+'" alt="Istorija plaćanja sa prikazom statusa uspešnih i neuspešnih uplata" style="display:block;margin:0 auto;max-width:900px;width:100%;border:1px solid #e5e7eb;border-radius:8px;"><figcaption style="margin-top:.5rem;color:#666;">Istorija plaćanja sa prikazom statusa uspešnih i neuspešnih uplata</figcaption></figure><h2 id="vazne-napomene" tabindex="-1">Važne napomene <a class="header-anchor" href="#vazne-napomene" aria-label="Permalink to “Važne napomene”">​</a></h2><ul><li>Privredna komora Srbije biće obaveštena o evidentiranoj uplati.</li><li>Pored uplate, obavezno je dostaviti svu dokumentaciju propisanu za konkretan zahtev.</li></ul><div class="tip custom-block"><p class="custom-block-title">Savet</p><p>Zahtev i prateću dokumentaciju potrebno je dostaviti Službi za javna ovlašćenja i Sertifikaciono telo PKS, na adresu Resavska 13-15, 11000 Beograd, u papirnoj formi, u originalu ili overenoj kopiji, nakon čega će predmet biti uzet u obradu.</p></div><h2 id="pomoc-i-podrska" tabindex="-1">Pomoć i podrška <a class="header-anchor" href="#pomoc-i-podrska" aria-label="Permalink to “Pomoć i podrška”">​</a></h2><p>Ukoliko imate nedoumica u vezi sa popunjavanjem obrazaca ili potrebnom dokumentacijom, preporučujemo da se pre podnošenja zahteva upoznate sa uputstvima u okviru svakog pojedinačnog obrasca.</p><p>Za sva dodatna pitanja i nedoumice, možete nam se obratiti putem e‑pošte na adresu <a href="mailto:admin@upravljajupravnikom.rs" target="_blank" rel="noreferrer">admin@upravljajupravnikom.rs</a>.</p>',18)])])}const b=e(l,[["render",p]]);export{h as __pageData,b as default};
